import { fetchFromServer } from "../Fetch";
import { GROUP_DATA } from "../ActionTypes";

export const fetchGroupData = group => async dispatch => {
  console.log(group);
  const data = `query {
    groupData {
    group(group: ${group}) {
       id
      regDate   
      name
       currency
      cycle
      boxBalance
      meetingsTotal
      perShare
      serviceFee
      loanLimit
      shares
      loans
      owner{
        firstName
        lastName
      }
      admin{
        firstName
        lastName
      }
       members
      }

    }
  }`;

  const response = await fetchFromServer("post", data);

  console.log(response);

  dispatch({
    type: GROUP_DATA,
    payload: response.data.data.groupData
  });
};
